import React from "react";
import PropTypes from "prop-types";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faAngleRight } from "@fortawesome/free-solid-svg-icons";
import "./NavigateMenu.scss";

NavigateMenu.propTypes = {
  listCategory: PropTypes.array,
};

function NavigateMenu(props) {
  return (
    <div className="NavMenu">
      <div className="ContainerCategory">
        <div className="TitleCategory">DANH MUC SAN PHAM</div>
        <ul>
          <li>
            Máy ảnh &amp; Máy quay phim
            <FontAwesomeIcon icon={faAngleRight} />
          </li>
          <li>Máy để bàn &amp; Laptop</li>
          <li>Điện thoại</li>
          <li>Máy tính bảng</li>
        </ul>
      </div>
      <div className="Menu">
        <ul>
          <li className="active">Trang chu</li>
          <li>Gioi thieu</li>
          <li>San pham</li>
          <li>Tin tuc</li>
          <li>Lien he</li>
        </ul>
      </div>
    </div>
  );
}

export default NavigateMenu;
